/**
 * @param {string[]} tokens
 * @return {number}
 */
var evalRPN = function (tokens) {
    var stack = [];
    for (var i = 0; i < tokens.length; i++) {
        if (!isNaN(parseInt(tokens[i]))) {
            stack.push(parseInt(tokens[i]))
        } else {
            var a = stack.pop();
            var b = stack.pop();
            if (tokens[i] === "+") {
                stack.push(a + b);
            } else if (tokens[i] === "*") {
                stack.push(a * b);
            } else if (tokens[i] === "-") {
                stack.push(b - a);
            } else if (tokens[i] === "/") {
                stack.push(parseInt(b / a));
            }
        }
    }
    return stack.pop();
};

